    def test19(self):
        gen = randomutils.Lcg31Random(seed=123456789)
        for i in range(1024):
            gen.random()
            assert isinstance(gen.seed, int)

    def test20(self):
        for _ in range(1024):
            seed = random.randint(1, 9)

            gen1 = randomutils.Lcg31Random(seed=seed)
            data1 = gen1.get_bytes(1024)

            gen2 = randomutils.Lcg31Random(seed=seed)
            data2 = gen2.get_bytes(1024)

            assert data1 == data2

    def test21(self):
        gen = randomutils.Lcg31Random(seed=123456789)
        length = random.randint(1024, 9999)
        data = set()
        for i in range(length):
            data.add(gen.get_bytes(8))
        assert len(data) == length

