    def test24(self):
        s1 = randomutils.get_password_seed32()
        s2 = randomutils.get_password_seed32("hello world")
        s3 = randomutils.get_password_seed32(b"hello world")
        s4 = randomutils.get_password_seed32(1234)
        s5 = randomutils.get_password_seed32(1234.5678)
        for s in [s1, s2, s3, s4, s5]:
            assert isinstance(s, int)
            assert s < 2**32

    def test25(self):
        assert randomutils.get_password_seed32("hello world") == 222957957
        assert randomutils.get_password_seed32(b"hello world") == 222957957
        assert randomutils.get_password_seed32(1234) == 1234
        assert randomutils.get_password_seed32(1234.5678) == 1234

    def test26(self):
        assert abs(randomutils.get_password_seed32() - time.time()) < 10

    def test27(self):
        for _ in range(1024):
            seed = os.urandom(32)
            gen1 = randomutils.Lcg31Random(seed=seed)
            gen2 = randomutils.Lcg31Random(seed=seed)
            assert gen1.get_bytes(1024) == gen2.get_bytes(1024)
